import React, { useState, useEffect } from 'react'
import axios from 'axios'

const Pans = () => {
    const [subreddit, setSubreddit] = useState([])

    useEffect(() => {
        axios.get(`https://www.reddit.com/r/castiron/top.json`)
            .then((res) => {
                console.log(res.data.data.children)
                setSubreddit(res.data.data.children)
            })
            .catch((err) => console.log(err))
    }, [])

    return (
        <div>
            <h1>Check out these hot pans</h1>
            <table>
                <tbody>
                    {
                        subreddit.map((post, i) => {
                            return (
                                <tr key={i}>
                                    <td><img src={`${post.data.thumbnail}`} height={`${post.data.thumbnail_height}`} width={`${post.data.thumbnail_width}`} alt="cast iron pan ppst" /></td>
                                    <td>{post.data.title}</td>
                                </tr>
                            )

                        })
                    }
                </tbody>
            </table>
        </div>
    )
}

export default Pans
